import React from 'react'
import './index.less'
import {Card, Button, message} from 'antd'
export default class Record extends React.Component {

    handleClick=()=> {
        message.success("HAHAHAH");
    }

    render(){
        return (
            <div class="container">
                <Card 
                    title = "Medical Record" 
                    className="cardWrap" 
                    bordered={false}
                    extra={
                        <Button type="primary" shape="round"><Icon type="plus" />New Record</Button>
                    }
                >
                </Card>
            </div>
        );
    }
}
